function setfromstr(str)
    local t = {}
    for p, c in utf8.codes(str) do
        t[utf8.char(c)] = true
    end
    return t
end

local charset = setfromstr(str)

function issubset(candidate, charset)
    for el, _ in pairs(candidate) do
        if not charset[el] then
            return false
        end
    end
    return true
end

local function yuhao_tc_first(input, env)
    local b = env.engine.context:get_option("yuhao_tc_first")
    local l = {}
    local length_of_input = string.len(env.engine.context.input)
    for cand in input:iter() do
        local candidate = setfromstr(cand.text)
        if (not b or issubset(candidate, charset) or (length_of_input < 4)) then
            yield(cand)
        else
            table.insert(l, cand)
        end
    end
    -- 非常用字词后置
    for i, cand in ipairs(l) do
        yield(cand)
    end
end

return yuhao_tc_first
